          bash\n\nREPO_URL=\"git@github.com:vgijssel/setup.git\"\nCLONE_PATH=\"/workspaces/setup\"\nBRANCH_NAME=\"\"\n#
          Expand home if it''s specified!\nCLONE_PATH=\"${CLONE_PATH/#\\~/${HOME}}\"\nDEPTH=\"0\"\n\n#
          Check if the variable is empty...\nif [ -z \"$REPO_URL\" ]; then\n  echo \"No
          repository specified!\"\n  exit 1\nfi\n\n# Check if the variable is empty...\nif
          [ -z \"$CLONE_PATH\" ]; then\n  echo \"No clone path specified!\"\n  exit
          1\nfi\n\n# Check if `git` is installed...\nif ! command -v git \u003e /dev/null;
          then\n  echo \"Git is not installed!\"\n  exit 1\nfi\n\n# Check if the directory
          for the cloning exists\n# and if not, create it\nif [ ! -d \"$CLONE_PATH\"
          ]; then\n  echo \"Creating directory $CLONE_PATH...\"\n  mkdir -p \"$CLONE_PATH\"\nfi\n\n#
          Check if the directory is empty\n# and if it is, clone the repo, otherwise
          skip cloning\nif [ -z \"$(ls -A \"$CLONE_PATH\")\" ]; then\n  if [ -z \"$BRANCH_NAME\"
          ]; then\n    echo \"Cloning $REPO_URL to $CLONE_PATH...\"\n    if [ \"$DEPTH\"
          -gt 0 ]; then\n      git clone --depth \"$DEPTH\" \"$REPO_URL\" \"$CLONE_PATH\"\n    else\n      git
          clone \"$REPO_URL\" \"$CLONE_PATH\"\n    fi\n  else\n    echo \"Cloning $REPO_URL
          to $CLONE_PATH on branch $BRANCH_NAME...\"\n    if [ \"$DEPTH\" -gt 0 ]; then\n      git
          clone --depth \"$DEPTH\" -b \"$BRANCH_NAME\" \"$REPO_URL\" \"$CLONE_PATH\"\n    else\n      git
          clone \"$REPO_URL\" -b \"$BRANCH_NAME\" \"$CLONE_PATH\"\n    fi\n  fi\nelse\n  echo
          \"$CLONE_PATH already exists and isn''t empty, skipping clone!\"\n  exit 0\nfi\n","cron":"","run_on_start":true,"run_on_stop":false,"start_blocks_login":true,"timeout":0,"display_name":"Git
