          ]; then\n    echo \"Cloning $REPO_URL to $CLONE_PATH...\"\n    if [ \"$DEPTH\"
          -gt 0 ]; then\n      git clone --depth \"$DEPTH\" \"$REPO_URL\" \"$CLONE_PATH\"\n    else\n      git
          clone \"$REPO_URL\" \"$CLONE_PATH\"\n    fi\n  else\n    echo \"Cloning $REPO_URL
          to $CLONE_PATH on branch $BRANCH_NAME...\"\n    if [ \"$DEPTH\" -gt 0 ]; then\n      git
          clone --depth \"$DEPTH\" -b \"$BRANCH_NAME\" \"$REPO_URL\" \"$CLONE_PATH\"\n    else\n      git
          clone \"$REPO_URL\" -b \"$BRANCH_NAME\" \"$CLONE_PATH\"\n    fi\n  fi\nelse\n  echo
