          [ -z \"$CLONE_PATH\" ]; then\n  echo \"No clone path specified!\"\n  exit
          1\nfi\n\n# Check if `git` is installed...\nif ! command -v git \u003e /dev/null;
          then\n  echo \"Git is not installed!\"\n  exit 1\nfi\n\n# Check if the directory
